			}}>
			  <div> 
			    <img style={{width:"160px",height:"160px",borderRadius:"80px"}}
          src="https://images.unsplash.com/photo-1550927407-50e2bd128b81?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxzZWFyY2h8NDV8fHBlcnNvbnxlbnwwfDJ8MHw%3D&auto=format&fit=crop&w=500&q=60" />
        </div>
				<div>
					<h4>ramesh verma</h4>
				</div>
      </div>
		</div>
    )
}

export default Profile;
